import React, { useEffect, useState, useRef } from 'react';
import { io } from 'socket.io-client';
import { useNavigate } from 'react-router-dom';
import './ChatRoom.css';

const SOCKET_SERVER_URL = 'http://localhost:5001';

const ChatRoom = ({ room }) => {
  const [message, setMessage] = useState('');
  const [messages, setMessages] = useState([]);
  const [users, setUsers] = useState([]);
  const chatEndRef = useRef(null);
  const socketRef = useRef();
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    const storedUser = JSON.parse(localStorage.getItem('user'));
    const fullName = storedUser?.fullName || 'Anónimo';
    const zodiacSign = storedUser?.zodiacSign || '';

    socketRef.current = io(SOCKET_SERVER_URL, {
      auth: { token },
    });

    socketRef.current.emit('joinRoom', { room, fullName, zodiacSign });

    socketRef.current.on('message', (msg) => {
      setMessages((prev) => [...prev, msg]);
      setTimeout(() => {
        chatEndRef.current?.scrollIntoView({ behavior: 'smooth' });
      }, 50);
    });

    socketRef.current.on('roomUsers', (usersList) => {
      const signosEmoji = {
        aries: '♈', tauro: '♉', geminis: '♊', cancer: '♋', leo: '♌',
        virgo: '♍', libra: '♎', escorpio: '♏', sagitario: '♐',
        capricornio: '♑', acuario: '♒', piscis: '♓'
      };

      const usersWithEmoji = usersList.map((u) => {
        const cleanSign = (u.zodiacSign || '')
          .toLowerCase()
          .normalize('NFD')
          .replace(/[\u0300-\u036f]/g, '');
        return {
          ...u,
          emoji: signosEmoji[cleanSign] || ''
        };
      });
      console.log('Usuarios recibidos:', usersWithEmoji);
      setUsers(usersWithEmoji);
    });

    return () => {
      socketRef.current.disconnect();
    };
  }, [room]);

  const sendMessage = (e) => {
    e.preventDefault();
    if (message.trim() === '') return;

    socketRef.current.emit('chatMessage', {
      room,
      text: message,
    });

    setMessage('');
  };

  const handleBack = () => {
    navigate(-1);
  };

  return (
    <div className="container">
      {/* ✅ Botón volver */}
      <button onClick={handleBack} className="backButton">
        ← Volver
      </button>

      <h2 className="title">
        Bienvenido a la sala: {room.charAt(0).toUpperCase() + room.slice(1)}
      </h2>

      <div className="usersBox">
        <h4 className="usersTitle">Usuarios conectados:</h4>
        {users.length === 0 ? (
          <p className="usersText">No hay usuarios</p>
        ) : (
          <ul className="usersList">
            {users.map((u) => (
              <li key={u.id} className="userItem">
                <span style={{ marginRight: 8 }}>{u.emoji}</span>{u.fullName}
              </li>
            ))}
          </ul>
        )}
      </div>

      <div className="chatBox">
        {messages.map((msg, i) => (
          <div key={i}>
            <b>{msg.user || 'Anon'}:</b> {msg.text || '(sin texto)'}{' '}
            <small>({new Date(msg.timestamp).toLocaleTimeString()})</small>
          </div>
        ))}
        <div ref={chatEndRef} />
      </div>

      <form onSubmit={sendMessage} className="form">
        <input
          type="text"
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          placeholder="Escribí tu mensaje..."
          className="input"
          autoComplete="off"
        />
        <button type="submit" className="sendButton">
          Enviar
        </button>
      </form>
    </div>
  );
};

export default ChatRoom;
